import "./ExpenseItem.css";
export const ExpenseItem = () => {
  return (
    <div className="expense-item">
      <div className="">March 28th 2021</div>
      <div>
        <div className="expense-item">Car Insurance</div>
        <div className="expense-item__price">$249.68</div>
      </div>
    </div>
  );
};
